    false,nt"url": null,nt"notes": "A method of predicting the destructive
    capacity of a tropical cyclone based on a new Wind Destructive Potential (WDP) and
    Storm Surge Destructive Potential (SDP) scales which provide a manner to rate the
    severity of hurricanes and typhoons, based on information provided in operational
    forecast and warning products, experimental wind field products, or gridded numerical
    weather prediction model outputs. These new scales are formulated to be consistent
    with the physical mechanism through which tropical cyclones impact coastal communities
